Have a look at testprotocol.php, that's a working example to use with a webserver.

Do you already have a WhatsApp password or not? And is your number registered by one of the APIs or by using the official app?

Try this code:

	<textarea>
	<?php
	$userPhone = "316********";
	$userIdentity = "345678907654654";
	$destinationPhone = '9665????????';
	$userName = "Derp";

	$w = new WhatsProt($userPhone, $userIdentity, $userName, true);
	$w->Connect();
	print_r($w->checkCredentials());
	$w->Login();

	$w->Message($destinationPhone, "Test message derp");

	while (TRUE) {
	    $w->PollMessages(); 
	    $msgs = $w->GetMessages(); 
	    foreach ($msgs as $m) 
	    {
		print_r($m);
	    }
	}
	?>

Great. Then copy that password to your file and use 

    $password = "KoeIpWdCcRNrdmjay5fe????????";
    $wa->Connect();
    $wa->LoginWithPassword($password);
to log in.
